import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';


export const Main = () => {   
     const navigate = useNavigate();
    return (
        <div> 
            <div>Welcome to Yash's Calculator</div>
            <div>What would u like to do?</div>

            <button onClick={() => navigate('/sum')}> ADD  </button>
            <button onClick={() => navigate('/SUB')}> SUB  </button>
            <button onClick={() => navigate('/sum')}> MUL  </button>
            <button onClick={() => navigate('/sum')}> DIV  </button>



        </div>
    );
}
